INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (9, 2, 1, 2, 3001, 8, 1, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 2.21, 12300149, 0, "vo_minigame_1012_result_1081", 5);
