INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (9, 2, 1, 2, 3001, 3, 1, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 2.94, 12300151, 0, "vo_minigame_1012_result_1083", 5);
INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (9, 3, 1, 2, 3001, 7, 1, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 4.19, 12300152, 0, "vo_minigame_1012_result_1084", 5);
INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (9, 3, 1, 2, 3001, 1, 1, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 0.0, 12300153, 0, "vo_minigame_1012_result_1085", 5);
INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (9, 3, 1, 2, 3001, 3, 1, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 2.63, 12300154, 0, "vo_minigame_1012_result_1086", 5);
INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (4, 1, 1, 2, 3001, 3, 1, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 5.53, 12300155, 0, "vo_minigame_1012_result_1087", 1);
INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (4, 1, 1, 2, 3001, 3, 3, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 0.01, 12300156, 9, "vo_minigame_1012_result_1088", 1);
