INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (4, 2, 1, 2, 3001, 9, 9, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 0.01, 12300158, 9, "vo_minigame_1012_result_1090", 1);
