INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (0, 1, 1, 2, 3001, 4, 2, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 3.63, 12300164, 1, "vo_minigame_1012_result_1096", 0);
